    fetch("http://localhost:9292/houses/4")
    .then((r)=> r.json())
      .then((test)=>setState(test))
  },[]);
  console.log(state)
  const displayNames = names.filter((student)=>{
    return student.name
  })

  console.log("(Sly) Students: ", names)
  console.log("(Sly) Students(test): ", state)

  return(
    <div>
      <header>
        Slytherin Students

      </header>
      {displayNames.map((name) =>{
        return <ListHouse
          key={name.id}
          id={name.id}
          house={name.name}
      /> 
    })}

    </div>

  )
}

